import React from "react";
import {BrowserRouter as Router, Link } from 'react-router-dom';
import '../assets/Home.css';

const Home = () =>{


    return(
        <div className="body">



    <Router>
        <ul>

            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i className="fas fa-calculator" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/accounting" className="link" > Accounting </Link></li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i className="fas fa-calculator" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/accounting/fetch-accounting-details" className="link" >Fetch Accounting </Link></li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i className="fas fa-calculator" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/accounting/edit-accounting-details" className="link" >Edit Accounting </Link></li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i className="fas fa-database" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/dataentry" className="link"  > Dataentry</Link> </li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i className="fas fa-database" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/edit-data-entered" className="link"  >Edit Data</Link> </li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i class="fas fa-calendar-alt" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/student-attendance/" className="link"  > Student Attendance</Link> </li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i class="fas fa-calendar-alt" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/church-attendance/" className="link"  > Church Attendance</Link> </li>
            <li style={{fontSize:20}} onClick={()=>window.location.reload()} ><i class="fas fa-calendar-alt" style={{fontSize:20,padding:10,position:'relative',left:'25px'}} ></i><Link to="/youtube-id-generator/" className="link"  > Youtube Link Generator</Link> </li>


        </ul>


    </Router>
    </div>
    )

}

export default Home;
